import logo from "../../images/header-logo.svg";
import { useLocation, Link } from "react-router-dom";

function Header() {
  return (
    <header className="header">
      <img src={logo} className="header__logo" alt="Логотип проекта" />
      {useLocation.pathname === "/" && (
        <div className="header__contener">
          <p className="header__user-email">
            {/* {email} */}
            </p>
          <Link className="header__button" to="/sign-in" 
          // onClick={onSignOut}
          >
            Выйти
          </Link>
        </div>
      )}
      {useLocation.pathname === "/sign-up" && (
        <div className="header__contener">
          <Link className="header__button" to="/sign-in">
            Войти
          </Link>
        </div>
      )}
      {useLocation.pathname === "/sign-in" && (
        <div className="header__contener">
          <Link className="header__button" to="/sign-up">
            Регистрация
          </Link>
        </div>
      )}
    </header>
  );
}

export default Header;
